import { Injectable } from '@angular/core';
import { ListItemsModel } from '../model/list-items.model';
import { Observable } from 'rxjs';

@Injectable({
  providedIn: 'root'
})
export class ListItemsService {
  apiUrl: string = 'http://localhost:3334/items';

  // httpOptions: {} = {
